**Example 1: Hardcoded strings in JavaScript code**

In a library or book order platform, you might have a JavaScript function that displays a success message when an order is placed:
```javascript
function displaySuccessMessage() {
  alert("Order placed successfully!");
}
```
**I18n Violation:** The string "Order placed successfully!" is hardcoded in the JavaScript code, making it difficult to translate for different languages.

**Fix:**

To make this code i18n compliant, you can use a separate file to store translations and load them dynamically. Create a `translations.json` file with the following content:
```json
{
  "en": {
    "orderPlaced": "Order placed successfully!"
  },
  "fr": {
    "orderPlaced": "Commande passée avec succès!"
  }
}
```
Then, modify the JavaScript code to load the translations and use the correct string:
```javascript
import translations from './translations.json';

function displaySuccessMessage() {
  const lang = getLanguage(); // assume getLanguage() returns the current language
  const translation = translations[lang].orderPlaced;
  alert(translation);
}
```
**Best Practice:** Use a separate file for translations and load them dynamically to make it easy to add or update translations.

**Example 2: Inconsistent file structure**

In a library or book order platform, you might have a file structure like this:
